import { MDBContainer, MDBFooter } from 'mdb-react-ui-kit';

const CustomFooter = () => {
    return (
        <MDBFooter className="text-center " light bgColor="dark" fixed="bottom">
            <MDBContainer className="text-center p-3">
                <span>
                    Página feita para treinamento de React Página feita para
                    treinamento de React
                </span>
            </MDBContainer>
        </MDBFooter>
    );
};

export default CustomFooter;
